import React from "react";
import HTML from "./assest/html.png";
import CSS from "./assest/css.png";
import JS from "./assest/js.svg";
import REACT from "./assest/react.svg";
import Bootstrap from "./assest/bootstrap.png";
import GSAP from "./assest/GSAP.png";

export default function skills() {
  return (
    <div>
     <section id="skills" className="skills-section">
  <h2>Skills</h2>

  <div className="skills-category">
    <h3>Frontend</h3>
    <div className="skills-grid">
      <div className="skill-item"><img src={HTML} alt="HTML" /><p>HTML</p></div>
      <div className="skill-item"><img src={CSS} alt="CSS" /><p>CSS</p></div>
      <div className="skill-item"><img src={JS} alt="JavaScript" /><p>JavaScript</p></div>
    </div>
  </div>

  <div className="skills-category">
    <h3>Libraries & Frameworks</h3>
    <div className="skills-grid">
      <div className="skill-item"><img src={REACT} alt="React" /><p>React</p></div>
      <div className="skill-item"><img src={Bootstrap} alt="Bootstrap" /><p>Bootstrap</p></div>
      <div className="skill-item"><img src={GSAP} alt="GSAP" /><p>GSAP</p></div>
    </div>
  </div>
</section>

    </div>
  );
}
